[PixAndVideo] Angel Blade (Front Page Babe / 200512 / 02.05.2015)

Angel arrived to a photo contest. She wants to be the new front page girl of a popular fashion magazine. She is shy... at least she is at first. But as the session goes on, she eases into the job more and more to the point when she starts to remove her clothes, looking for the photographer's approval. Well, she gets more than a simple approval...

